$('input[type=file]').change(function (eve) {
    var t = $(this).val();
    var reader = new FileReader();
    var f = eve.target.files[0]

    // Closure to capture the file information.
    reader.onload = (function (theFile) {
        $('.csv-error').html('')
        $('.csv-success').html('')
        return function (e) {
            let js = $.csv.toObjects(e.target.result)
            // remove empty objects
            js = js.filter(d => Object.values(d).find(el => el !== ''))
                .map(d => (
                    {
                        name: d.name,
                        attributes: d.attributes,
                        description: d.description,
                        data_type: d.data_type,
                        display_name: d.display_name,
                        icon: d.icon,
                        is_probe: d.is_probe,
                    }
                ))
            CB_PORTAL.Loader.waitFor(datasources.createSensorType.sendData({ sensor_types: js }).then(res => {
                if (res.success === false) {
                    $('.csv-error').html(res.results)
                    return
                }
                if (res.results.err) {
                    $('.csv-error').html(res.results.message)
                } else {
                    $('.csv-success').html("Successfully Uploaded")
                    datasources.getSensorTypes.sendData()
                }
            }), 'upload-csv-btn')
        };
    })(f);

    // Read in the image file as a data URL.
    reader.readAsText(f);

})

//JavaScript

const wordsFromOp = {
  GT: 'is above',
  LT: 'is below',
  EQ: 'is exactly',
};


if (!this.datasource || this.datasource === 'none') {
    $(".filter-alert-history").hide()
} else {
    $(".filter-alert-history").show()
    const alertConfig = datasources.getAlertConfigurations.latestData().results.payload.DATA.find(a => a.item_id === this.datasource)

    $("#alert-config-filter").html(alertConfig ? alertConfig.name + `<div class="text-muted">${AlertConfigSummary(alertConfig)}</div>` : '')

    if (!window.firstSetupFilterAlertHistory) {
        window.firstSetupFilterAlertHistory = true
        $("body").on('click', '.clear-alert-config-filter', () => { datasources.currentAlertConfigId.sendData('none') })
        $("body").on('click', '.ReactTable a', e => e.preventDefault())
        // fix for "View" link redirecting to home page
    }
}

function AlertConfigSummary(alertConfig) {
    const rules = tryParse(alertConfig.rules)
    let text = rules && rules.map((rule) => RuleSummary(rule)).join(' and ')
    if(alertConfig.timeout) {
        text = text + ` for ${alertConfig.timeout} minutes`
    }
    return text
}

function RuleSummary(rule = {}) {
    const sensor = datasources.getSensors.latestData().results.payload.DATA.find((s) => s.sensor_id === rule.sensor_id) || {}
    const sensorType = datasources.getSensorTypes.latestData().results.payload.DATA.find((s) => s.item_id === sensor.sensor_type_id) || {}

    const propertyStr = rule.property === 'battery_level' ? 'Battery' : sensorType.display_name
    const operatorStr = (sensorType.data_type === 'int' || rule.property === 'battery_level') ? wordsFromOp[rule.operator] : ''
    const valueStr = (sensorType.data_type === 'int' || rule.property === 'battery_level') ? rule.value : (rule.value ? 'is open' : 'is closed')
    const attributeStr = rule.property === 'battery_level' ? 'percent' : sensorType.attributes
    return `"${sensor.sensor_label}" ${propertyStr && propertyStr.toLowerCase()} ${operatorStr} ${valueStr} ${attributeStr && attributeStr.toLowerCase()}`
}

function tryParse(str) {
    try {
        return JSON.parse(str)
    } catch(e) {
        console.warn(e, str)
    }
}

