    localVarName = datasourceKeys[1]
    listSourceName = datasourceKeys[0]
} else {
    localVarName = datasourceKeys[0]
    listSourceName = datasourceKeys[1]
}

formSourceObj.schema = this.dsModel[listSourceName].getCRUDSchema();

if (this.datasource[localVarName]) {
    if (typeof this.datasource[localVarName] === 'string') {
        // assumes your localVar is the row key
        formSourceObj.rowKey = this.datasource[localVarName]
    } else {
        // assumes your localVar is in this structure: { item_id: '12345' }      
        formSourceObj.rowKey = this.datasource[localVarName][formSourceObj.keyColumn];
    }
    formSourceObj.data = this.datasource[listSourceName].find(row => row.data[formSourceObj.keyColumn] === formSourceObj.rowKey).data;
}

return formSourceObj;

