    //     const x = Number(mySensorValueText.attr('x'));
    //     const y = Number(mySensorValueText.attr('y'));
    //     console.log('stuff', width, height, x, y);
    //     const unitX = x + width + 10;
    //     const unitElem = $('<text></text>');
    //     unitElem.attr('x', unitX);
    //     unitElem.attr('y', y);
    //     mySensorValueText.after(unitElem);
    //     // .text(`${value}*C`)
    // })
}

const updateTempGauges = (sensorMsg, order) => {
    updateSingleGauge(sensorMsg.sensorID, order, getLabelForSensor(sensorMsg), sensorMsg.dataValue, sensorMsg.messageDate, sensorMsg);
}

const getLabelForSensor = (sensorMsg) => {
    try {
        if (datasources.getSensors.lastUpdated) {
            const sensors = datasources.getSensors.latestData().results.payload.DATA;
            for (let i = 0, len = sensors.length; i < len; i++) {
                if (sensors[i].sensor_id === sensorMsg.sensorID) {
                    return sensors[i].sensor_label;
                }
            }
        }
    } catch (e) {

    }
    return sensorMsg.sensorName;
}

const updateDoorToggle = (sensorMsg) => {
    let val = false;
    if (sensorMsg.dataValue === 'True') {
        val = true;
    }
    $('#assetSensor1').show();
    datasources.assetSensor1.sendData({ value: val });
}

const messageReceived = (order, msg) => {
    let parsedMsg;
    try {
        parsedMsg = JSON.parse(msg);
    } catch (e) {
        console.error('Failed to parse message', e);
    }
    if (parsedMsg) {
        if (parsedMsg.sensor_message && parsedMsg.sensor_message.dataType) {
            const dataType = parsedMsg.sensor_message.dataType;
            switch (dataType) {
                case 'Percentage|TemperatureData':
                    updateHumidityGauges(parsedMsg.sensor_message, order);
                    break;
                case 'TemperatureData':
                    updateTempGauges(parsedMsg.sensor_message, order);
                    break;
                case 'DoorData':
                    updateDoorToggle(parsedMsg.sensor_message);
                    break;
            }
        }
    }
}

const setupMessaging = () => {
    return new Promise((resolve) => {
        if (!window.messagingObjectForSensors) {
            window.sensorSubscriptions = [];
            window.messagingObjectForSensors = CB_PORTAL.ClearBlade.Messaging({ useSSL: true }, resolve);
        } else {
            window.sensorSubscriptions.forEach((sub) => {
                try {
                    window.messagingObjectForSensors.unsubscribe(sub.topic, {});
                } catch (e) {
                    console.error('Unable to unsub from topics', e);
                }
            })

            window.sensorSubscriptions = [];
            resolve();
        }
    })
}

const messageHistoryCallback = (order, err, data) => {
    if (!err) {
        if (data && data[0]) {
            messageReceived(order, data[0].message);
        }
    }
}

const resetGauges = () => {
    $('#assetSensor1').hide();
    $('#assetSensor2').hide();
    $('#assetSensor3').hide();
    $('#assetSensor4').hide();
    $('#assetSensor5').hide();
    $('#assetSensor6').hide();
    datasources.assetSensor1.sendData(false);
    datasources.assetSensor2.sendData({ label: 'N/A', value: 0 });
    datasources.assetSensor3.sendData({ label: 'N/A', value: 0 });
    datasources.assetSensor4.sendData({ label: 'N/A', value: 0 });
    datasources.assetSensor5.sendData({ label: 'N/A', value: 0 });
    datasources.assetSensor6.sendData({ label: 'N/A', value: 0 });
}

const updateGauges = (sensors) => {
    resetGauges();
    // start the counter at 2 because 1 is reserved for the 'door open' toggle
    let counter = 2;
    sensors.forEach((s) => {
        const sensorType = getSensorTypeById(datasources.getSensorTypes.latestData().results.payload.DATA, s.sensor_type_id);
        const topicName = `monnit-webhook-adapter/${s.sensor_id}`;
        // if the dataType is a bool we assume it's the door sensor; else we just assign the order as they come back to us from the collection
        const dsOrder = sensorType.data_type === 'bool' ? 1 : counter;
        window.sensorSubscriptions.push({ topic: topicName });
        window.messagingObjectForSensors.subscribe(topicName, {}, messageReceived.bind(this, dsOrder));
        CB_PORTAL.ClearBlade.MessagingStats().getMessageHistory(topicName, new Date().getTime(), 1, messageHistoryCallback.bind(this, dsOrder))
        // we only want to increment the counter if this sensor data_type is not bool
        if (sensorType.data_type !== 'bool') {
            counter += 1;
        }
    })
}

const assetId = this.widget.item_id;
datasources.getSensors.sendData({ asset_id: assetId }).then((data) => {
    let sensors;
    try {
        sensors = data.results.payload.DATA;
    } catch (e) {
        console.error('error parsing sensors after selecting asset', e);
    }
    if (sensors && Array.isArray(sensors)) {

        // update the history line chart
        try {
            datasources.sensorHistoryIds.sendData(sensors.map((s) => s.sensor_id))
            if (datasources.sensorHistoryTimeRange.lastUpdated) {
                const timeRange = datasources.sensorHistoryTimeRange.latestData();
                datasources.getHistoryForSensors.sendData({
                    sensor_ids: datasources.sensorHistoryIds.latestData(),
                    startTime: timeRange.startDate.toISOString(),
                    endTime: timeRange.endDate.toISOString()
                })
            }
        } catch (e) {
            console.error('error parsing sensors after selecting asset', e);
        }
        console.log(`list of sensors for ${assetId}`, sensors);
        setupMessaging().then(() => {
            // update the 'latest data' gauges
            try {
                updateGauges(sensors);
            } catch (e) {
                console.error('error updating gauges', e);
            }
        })
    }
})
return this.widget;

