$('input[type=file]').change(function (eve) {
    var t = $(this).val();
    var reader = new FileReader();
    var f = eve.target.files[0]

    // Closure to capture the file information.
    reader.onload = (function (theFile) {
        $('.csv-error').html('')
        $('.csv-success').html('')
        return function (e) {
            let js = $.csv.toObjects(e.target.result)
            // remove empty objects
            js = js.filter(d => Object.values(d).find(el => el !== ''))
                .map(d => (
                    {
                        customer_id: d.customer_id,
                        employee_id: d.employee_id,
                        gateway_description: d.gateway_description,
                        gateway_id: d.gateway_id,
                        gateway_label: d.gateway_label,
                        gateway_name: d.gateway_name,
                        location_id: d.location_id,
                        network_id: d.network_id,
                        notes: d.notes,
                        signal_strength: d.signal_strength,
                    }
                ))
            CB_PORTAL.Loader.waitFor(datasources.createGateway.sendData({ gateways: js }).then(res => {
                if (res.results.err) {
                    $('.csv-error').html(res.results.message)
                } else {
                    $('.csv-success').html("Successfully Uploaded")
                    datasources.getGateways.sendData()
                }
            }), 'upload-csv-btn')
        };
    })(f);

    reader.readAsText(f);
})

