//     window.hasSetupAlertListeners = false;
//   }
// });

if (!window.hasSetupAlertListeners) {
  if ($('#alert-list').length > 0) {
    window.hasSetupAlertListeners = true
  }

  function TimeoutDiv(timeout) {
    return `<div>
        <div class="input-group mb-2">
          <div class="input-group-prepend">
            <div class="input-group-text">Rule broken for</div>
          </div>
          <input type="number" class="form-control" id="timeout-minutes" value="${timeout}">
          <div class="input-group-append">
            <div class="input-group-text">minutes before alert</div>
          </div>
        </div>
      </div>`
  }

  const AndDiv = `<div class="text-center text-muted mb-1 and-div">AND</div>`


  const wordsFromOp = {
    GT: 'is above',
    LT: 'is below',
    EQ: 'is exactly',
  };


  function PropertyDiv(rule, sensorType) {
    return `
      <div class="input-group-prepend">
              <select class="custom-select" id="property">
                <option value="sensor_reading" ${'sensor_reading' === rule.property ? 'selected' : ''}>${sensorType.display_name}</option>
                <option value="battery_level" ${'battery_level' === rule.property ? 'selected' : ''}>Battery</option>
              </select>
      </div>
  `
  }

  // -- SensorRuleDiv --
  function SensorRuleDiv(rule = {}) {
    if (!rule.sensor_id) {
      return `<div id="sensor-rule" class="input-group mb-2" />`
    }
    const sensor = datasources.getSensors.latestData().results.payload.DATA.find((s) => s.sensor_id === rule.sensor_id) || {}
    const sensorType = datasources.getSensorTypes.latestData().results.payload.DATA.find((s) => s.item_id === sensor.sensor_type_id) || {}
    if (rule.property === 'battery_level') {
      return `
    <div id="sensor-rule" class="input-group mb-2">
      <div class="input-group-prepend">
        ${PropertyDiv(rule, sensorType)}
      </div>

      <select class="custom-select d-none" id="operator">
          <option value="LT" selected>is below</option>
      </select>

      <div class="input-group-append">
        <div class="input-group-text">is below</div>
      </div>

      <input type="number" class="form-control" id="value" value="${rule.value}">

      <div class="input-group-append">
        <div class="input-group-text">percent</div>
      </div>
    </div>`
    }
    if (sensorType.data_type === 'int') {
      return `
      <div id="sensor-rule" class="input-group mb-2">
        <div class="input-group-prepend">
          ${PropertyDiv(rule, sensorType)}
        </div>

        <select class="custom-select" id="operator">
          ${Object.keys(wordsFromOp).map(op => (
          `<option value="${op}" ${op === rule.operator ? 'selected' : ''}>${wordsFromOp[op]}</option>`
        ))}
        </select>

        <input type="number" class="form-control" id="value" value="${rule.value}">

        <div class="input-group-append">
          <div class="input-group-text">${sensorType.attributes}</div>
        </div>
      </div>`
    } else {
      return `
      <div id="sensor-rule" class="input-group mb-2">
        <div class="input-group-prepend">
          ${PropertyDiv(rule, sensorType)}
        </div>

        <select class="custom-select" id="value">
          <option value="true" ${rule.value === true ? 'selected' : ''}>is open</option>
          <option value="false" ${rule.value === false ? 'selected' : ''}>is closed</option>
        </select>

        <input class="d-none" id="operator" value="EQ">
      </div>`
    }
  }

  // --- RULE DIV ---
  function RuleDiv(rule = {}) {
    const sensor = datasources.getSensors.latestData().results.payload.DATA.find((s) => s.sensor_id === rule.sensor_id) || {}
    let sensorOptions = datasources.getSensors.latestData().results.payload.DATA
    if (window.asset_id) {
      sensorOptions = sensorOptions.filter(s => s.asset_id === window.asset_id)
    }
    return `
<div class="rule">
  ${AndDiv}
  <div class="input-group">
    <select class="custom-select" id="sensor">
      <option selected>choose sensor...</option>
      ${sensorOptions.map((s) => (
        `<option value="${s.sensor_id}" ${s.sensor_id === rule.sensor_id ? 'selected' : ''}>${s.sensor_label || s.sensor_name}</option>`
      ))}
    </select>
    <div class="input-group-append">
      <div class="delete-alert-rule input-group-text"><i class="fa fa-trash" aria-hidden="true"></i></div>
    </div>
  </div>

  ${SensorRuleDiv(rule)}
</div>
`
  }

  function AssetsSelect(asset_id = '') {
    return `
    <select class="form-control" id="asset-id">
      <option value="">-- select --</option>
      ${datasources.getAssets.latestData().results.payload.DATA.map((a) => (
        `<option value="${a.item_id}" ${a.item_id === asset_id ? 'selected' : ''}>${a.name}</option>`
      )).join('')}
    </select>`
  }

  // --- FORM DIV ---
  function FormDiv({ location = '', message = '', timeout = 0, asset_id = '', contacts = [], contact_method = '', name = '', priority = '', rules = [], item_id = '' } = {}) {
    console.log({ location, contacts, contact_method, rules })
    return `
<form>
<div class="row">
  <input class="d-none" id="item-id" value="${item_id}">

  <div class="form-group col-sm-6">
    <label for="name">Name</label>
    <input class="form-control" id="name" value="${name}" aria-describedby="assetId">
  </div>

  <div class="form-group col-sm-6">
    <label for="priority">Priority</label>
    <select class="custom-select" id="priority">
      <option value="low" ${priority === "low" ? 'selected' : ''}>Low</option>
      <option value="medium" ${priority === "medium" ? 'selected' : ''}>Medium</option>
      <option value="high" ${priority === "high" ? 'selected' : ''}>High</option>
    </select>
  </div>
</div>

<hr />

<div class="row">
  <div class="form-group col-sm-6">
    <label for="location">Location</label>
      <select class="form-control" id="location">
        <option>-- select --</option>
        ${datasources.getLocations.latestData().results.payload.DATA.map((loc) => (
        `<option value="${loc.item_id}" ${loc.item_id === location ? 'selected' : ''}>${loc.name}</option>`
      )).join('')}
      </select>
  </div>
  <div class="form-group col-sm-6">
    <label for="asset-id">Asset</label>
    ${AssetsSelect(asset_id)}
  </div>

</div>

  <div class="rules">
    ${rules.length === 0 ? RuleDiv() : rules.map(rule => RuleDiv(rule)).join('')}
  </div>

  <button type="button" id="add-rule-btn" class="btn btn-secondary my-3">+ Add rule</button>
  ${TimeoutDiv(timeout)}  

  <hr/>

  <div class="form-group">
  <small class="form-text text-muted">Control click to select multiple recipients</small>
    <select multiple class="form-control" id="contacts">
      ${datasources.getEmployees.latestData().results.payload.map((contact) => (
        `<option value="${contact.email}" ${contacts.includes(contact.email) ? 'selected' : ''}>${contact.first_name} ${contact.last_name}</option>`
      )).join('')}
    </select>
  </div>

  <div class="form-group mt-2">
    <label for="message">Message</label>
    <textarea class="form-control" id="message" rows="3">${message}</textarea>
  </div>

</form>
    `
  }

  // -- ALERT LIST CLICKS --

  $("body").on('click', '.edit-alert', ({ currentTarget }) => {
    const data_id = currentTarget.dataset.itemId
    const alert = datasources.getAlertConfigurations.latestData().results.payload.DATA.find((data) => data.item_id === data_id)
    alert.contacts = tryParse(alert.contacts) || []
    alert.rules = tryParse(alert.rules) || []
    $('#alert-settings-title').html('Edit Alert')
    $('#submit-btn').html('Update')
    $('#submit-btn').data({ isEdit: true })
    $("#alert-settings").html(() => {
      return `<div>${FormDiv(alert)}</div>`
    })
  })

  $("body").on('click', '.alert-list-item', ({ target }) => {
    datasources.currentAlertConfigId.sendData(target.dataset.itemId);
    console.log(target.dataset.itemId)
  })

  $("body").on('click', '.delete-alert', ({ currentTarget }) => {
