const getLabelForSensor = (sensorID) => {
    try {
        if (datasources.getSensors.lastUpdated) {
            const sensors = datasources.getSensors.latestData().results.payload.DATA;
            for (let i = 0, len = sensors.length; i < len; i++) {
                if (sensors[i].sensor_id === sensorID) {
                    return sensors[i].sensor_label;
                }
            }
        }
    } catch (e) {

    }
    return sensorID;
}

try {
    const results = this.datasource.results.payload;
    const sample = results[results.length - 1];
    const nonSensorKeys = ['timestamp'];
    const sensors = Object.keys(sample).filter((k) => {
        return nonSensorKeys.indexOf(k) === -1;
    })
    const defaultYAxis = { "orientation": "left", "paddingTop": 0, "paddingBottom": 0, "showStandardDeviations": false, "numberStandardDeviations": 2, "standardDeviationLabel": "", "lowerBound": 0, "autoBounds": false, "dataKey": "", "upperBound": 80 }
    const defaultLine = { "type": "monotone", "legendType": "star", "dataKey": "385259" }
    console.log('sense', sensors);
    const currentSettings = this.model.settings();
    console.log('hey', currentSettings)
    const newSettings = {
        ...currentSettings,
        // yAxes: sensors.map((s) => ({
        //     ...defaultYAxis,
        //     dataKey: s,
        // })),
        yAxes: [defaultYAxis],
        lines: sensors.map((s, idx) => {
            let name = getLabelForSensor(s);
            if (name !== s) {
